import logo1 from './logo1.svg';
import './App.css';

function App() {
  return (

    <div className="App">
      <header className="App-header">
        <p>
          Prueba despliegue continuo!
        </p>
        <img src={logo1} className="App-logo" alt="logo" />
        <p>
          Arq Cloud
        </p>

      </header>
    </div>
  );
}

export default App;
